import React from 'react'
import './Category.css';
import { ShopCategory } from '../Assets/all_product'
import CategoryCard from './CategoryCard';

export const Category = () => {
  return (
    <div id="categories">
        <div className="title">
            <h2>Categories</h2>
        </div>
        <div className="categories-container container">
            {
                ShopCategory.map((category,i) => {
                    return <CategoryCard key={i} thumbnail={category.thumbnail} title={category.title}/>
                })
            }

        </div>

    </div>
  )
}
